      .loader,

        position: relative;
        text-indent: -9999em;

        z-index: 2;
        width: 700px;
        animation: spin 1.1s infinite ease-in-out;
        transform: scale(4);
      }

        0% {
          transform: rotate(0);
        }
        20% {
          transform: rotate(-3.2deg);
        }
        80% {
          transform: rotate(360deg);
        }
        90% {
          transform: rotate(370deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }
